import React from 'react';
import './App.css';

const Page1 = () => {
  return (
    <div className="page">
      <h1>Page 1</h1>
      <p>This is the content of Page 1.</p>
    </div>
  );
};

const Page2 = () => {
  return (
    <div className="page">
      <h1>Page 2</h1>
      <p>This is the content of Page 2.</p>
    </div>
  );
};

const Process = () => {
  return (
    <div className="container">
      <Page1 />
      <Page2 />
    </div>
  );
};

export default Process;
